import logo from "./logo.svg";
import "./App.css";
import TodoRoWItem from "./components/TodoRowItem";

function App() {
  const todos = [
    { rowNumber: 1, rowDescription: "Free the Hound", rowAssign: "Ion" },
    { rowNumber: 2, rowDescription: "Catch a Seal", rowAssign: "Gica" },
    { rowNumber: 3, rowDescription: "Beat a Kangaroo", rowAssign: "Vasile" },
  ];

  return (
    <div className="mt-5 container">
      <div className="card">
        <div className="card-header">Your todo`s</div>
        <div className="card-body">
          <table className="table table-hover">
            <thead>
              <tr>
                <th scope="col">#</th>
                <th scope="col">Description</th>
                <th scope="col">Assigned</th>
              </tr>
            </thead>

            <tbody>
              <TodoRoWItem
                rowNumber={todos[0].rowNumber}
                rowDescription={todos[0].rowDescription}
                rowAssign={todos[0].rowAssign}
              />

              <TodoRoWItem
                rowNumber={todos[0].rowNumber}
                rowDescription={todos[0].rowDescription}
                rowAssign={todos[0].rowAssign}
              />
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default App;
